import {
    gymbg,
    pianobg
} from '../../jss/masterStyle.js';

const dashboardStyle = theme => ({
    container: {
        padding: "20px",
    },
    paperCalendar: {
        padding: "0px",
        textAlign: "center",
        height: "400px",
    },
    calTitle: {
        paddingTop: "30px",
    },
    paperStats: {
        padding: "0px",
        textAlign: "center",
        height: "150px",
    },
    gymBackground:{
        padding: "0px",
        textAlign: "center",
        height: "150px",
        background: `linear-gradient(to right, transparent, white), url(${gymbg})`,
        backgroundSize: "35% 100%",
        backgroundRepeat: "no-repeat"
    },
    pianoBackground:{
        padding: "0px",
        textAlign: "center",
        height: "150px",
        background: `linear-gradient(to right, transparent, white), url(${pianobg})`,
        backgroundSize: "35% 100%",
        backgroundRepeat: "no-repeat"
    }
});

export default dashboardStyle;
